import React from "react";
import "./style.css";

function Card() {
    return (
        <div className="card">
            <div className="card-header">
                <p className="card-title">Details Of Park</p>
            </div>
            <div className="card-body">
                <p className="card-text">
                </p>
            </div>
        </div>

    );
}
export default Card;
